// App.js
import React from 'react';
import { Route } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div>

      <div>
        <Route exact path='/' component={Home} />
        <Route path='/about' component={About} />
        <Route path='/dashboard' component={Dashboard} />
      </div>

    </div>
  );
}

// Dummy Functional Components
const Home = () => {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
const About = () => {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}
const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
    </div>
  );
}

export default App;
